INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, 1, "カリン", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 0.0, -416.5, 62, 1000001, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 190801, 3.414, 1, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (2, 1, "カリン", "ミッションをクリアして、\n報酬をゲットしましょう！", 0.0, -416.5, 62, 1000002, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 190801, 3.099, 1, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (3, 1, "カリン", "受け取ることができる\n報酬があるようです\n確認してみてください", 0.0, -416.5, 63, 1000003, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 190801, 2.801, 1, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (4, 2, "カリン", "報酬がもらえますよ！\nチェックしてみてください", 0.0, -416.5, 63, 1000004, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 190801, 0.0, 1, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (5, 2, "カリン", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 0.0, -363.0, 64, 1000005, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 190801, 2.12, 1, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (6, 1, "カリン", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 0.0, -363.0, 64, 1000006, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 190801, 1.68, 1, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (7, 2, "カリン", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 0.0, -363.0, 64, 1000007, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 190801, 2.33, 1, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 3, "ラビリスタ", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0, -285.0, 61, 1020101, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 133701, 5.18, 10201, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "クリスティーナ", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0, -285.0, 61, 1020102, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 133901, 8.77, 10201, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, 6, "ネネカ", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0, -285.0, 61, 1020103, "2025/01/31 12:00:00", "2030/01/01 14:59:59", 133801, 15.5, 10201, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 2, "ランファ", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0, -285.0, 61, 1020201, "2025/02/28 12:00:00", "2030/01/01 14:59:59", 134301, 9.061, 10202, 5);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "チカ", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0, -285.0, 61, 1020202, "2025/02/28 12:00:00", "2030/01/01 14:59:59", 134401, 7.699, 10202, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 1, "アオイ", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0, -285.0, 61, 1020301, "2025/03/31 12:00:00", "2030/01/01 14:59:59", 134601, 8.595, 10203, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "クローチェ", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0, -285.0, 61, 1020302, "2025/03/31 12:00:00", "2030/01/01 14:59:59", 134501, 7.758, 10203, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 2, "ルイズマリー", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0, -285.0, 61, 1020401, "2025/04/30 12:00:00", "2030/01/01 14:59:59", 132302, 7.0, 10204, 6);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "イロハ", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0, -285.0, 61, 1020402, "2025/04/30 12:00:00", "2030/01/01 14:59:59", 132402, 7.904, 10204, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, 4, "ソノ", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0, -285.0, 61, 1020403, "2025/04/30 12:00:00", "2030/01/01 14:59:59", 132502, 8.487, 10204, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 1, "カノン", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 0.0, -285.0, 61, 1020502, "2025/05/31 12:00:00", "2030/01/01 14:59:59", 134901, 8.763, 10205, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "ツムギ", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 0.0, -285.0, 61, 1020503, "2025/05/31 12:00:00", "2030/01/01 14:59:59", 134801, 6.417, 10205, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 3, "エリス", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 0.0, -285.0, 61, 1020601, "2025/06/30 12:00:00", "2030/01/01 14:59:59", 135001, 10.335, 10206, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 2, "シェフィ", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 0.0, -285.0, 61, 1020602, "2025/06/30 12:00:00", "2030/01/01 14:59:59", 135101, 6.281, 10206, 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, 1, "プレシア", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 0.0, -285.0, 61, 1020603, "2025/06/30 12:00:00", "2030/01/01 14:59:59", 135201, 12.244, 10206, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 2, "クリア", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 0.0, -285.0, 61, 1020701, "2025/07/31 12:00:00", "2030/01/01 14:59:59", 135301, 6.339, 10207, 8);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 7, "アネモネ", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 0.0, -285.0, 61, 1020702, "2025/07/31 12:00:00", "2030/01/01 14:59:59", 135401, 8.184, 10207, 9);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 9, "アイラ", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 0.0, -285.0, 61, 1020801, "2025/08/31 12:00:00", "2030/01/01 14:59:59", 129101, 3.906, 10208, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "シナツ", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 0.0, -285.0, 61, 1020802, "2025/08/31 12:00:00", "2030/01/01 14:59:59", 129201, 14.465, 10208, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, 4, "ヒヨリ", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 0.0, -285.0, 61, 1020803, "2025/08/31 12:00:00", "2030/01/01 14:59:59", 100101, 8.662, 10208, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (401, 1, "レイ", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 0.0, -285.0, 61, 1020804, "2025/08/31 12:00:00", "2030/01/01 14:59:59", 100301, 10.915, 10208, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 1, "ユキノ", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 0.0, -285.0, 61, 1020901, "2025/09/30 12:00:00", "2030/01/01 14:59:59", 135802, 6.042, 10209, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 4, "サツキ", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 0.0, -285.0, 61, 1020902, "2025/09/30 12:00:00", "2030/01/01 14:59:59", 135903, 9.402, 10209, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, 8, "ルルィ", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 0.0, -285.0, 61, 1020903, "2025/09/30 12:00:00", "2030/01/01 14:59:59", 136902, 8.16, 10209, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 3, "カスミ", "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 0.0, -285.0, 61, 1021001, "2025/10/31 12:00:00", "2030/01/01 14:59:59", 137401, 5.0, 10210, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 4, "アラクネ", "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 0.0, -285.0, 61, 1021002, "2025/10/31 12:00:00", "2030/01/01 14:59:59", 136001, 8.12, 10210, 1);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, 4, "ナーナ", "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 0.0, -285.0, 61, 1021003, "2025/10/31 12:00:00", "2030/01/01 14:59:59", 136202, 6.386, 10210, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 3, "ユイ", "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 0.0, -285.0, 61, 1021101, "2025/11/30 12:00:00", "2030/01/01 14:59:59", 136402, 7.438, 10211, 4);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "ミソラ", "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 0.0, -285.0, 61, 1021102, "2025/11/30 12:00:00", "2030/01/01 14:59:59", 136302, 8.35, 10211, 5);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 1, "シズル", "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", 0.0, -285.0, 61, 1021201, "2025/12/31 12:00:00", "2030/01/01 14:59:59", 136501, 5.0, 10212, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "リノ", "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", 0.0, -285.0, 61, 1021202, "2025/12/31 12:00:00", "2030/01/01 14:59:59", 137902, 5.25, 10212, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, 1, "ラビリスタ", "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", 0.0, -285.0, 61, 1021203, "2025/12/31 12:00:00", "2030/01/01 14:59:59", 106801, 7.5, 10212, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (101, 1, "ライラエル", "漂う異国の料理の香り…それだけで\n世界中を旅した気分に浸れますね\nふふ、ほらクローチェ\nあまりはしゃぎすぎないように…♪", 0.0, -285.0, 61, 1021301, "2026/01/31 12:00:00", "2030/01/01 14:59:59", 126501, 8.204, 10213, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (201, 1, "ネフィ＝ネラ", "異界の姫君と煮炊きにて競い合う…\n感奮興起、いとをかし\n華やかなる祭典と相成るよう、一肌\n脱がせていただきとう存じまする", 0.0, -285.0, 61, 1021302, "2026/01/31 12:00:00", "2030/01/01 14:59:59", 129701, 7.176, 10213, 2);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (301, 1, "ヴァイオレット", "『ビストロプリンセス』のために\n料理の特訓を重ねてまいりました\nこの料理で騎士様の…い、いえ\n皆様の心とお腹を満たしますわ！", 0.0, -285.0, 61, 1021303, "2026/01/31 12:00:00", "2030/01/01 14:59:59", 133101, 8.602, 10213, 5);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (102, 1, "ライラエル", "多様な味わいが織りなすハーモニー\nそれこそが我が国の矜持です\nもしもそれを乱すようであれば\nわたしも優しくはありませんよ？", 0.0, -285.0, 61, 1021304, "2026/02/06 12:00:00", "2030/01/01 14:59:59", 138101, 10.14, 10213, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (202, 1, "ネフィ＝ネラ", "煉獄の穢土にてひと際輝く民草の心\n此れを守護りまするがわっちの責務\n如何な困難待ち受けようと\n不退転の矜持に揺らぎはありんせん", 0.0, -285.0, 61, 1021305, "2026/02/06 12:00:00", "2030/01/01 14:59:59", 138201, 10.152, 10213, 7);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (302, 4, "ヴァイオレット", "裏世界の皆様は危機を脱し、\n残るはランドソルの皆様のみ…\n彼らを救い出すために、どうか…\nお立ち下さいペコリーヌ姫…！", 0.0, -285.0, 61, 1021306, "2026/02/06 12:00:00", "2030/01/01 14:59:59", 138001, 9.688, 10213, 3);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (401, 2, "ペコリーヌ", "みなさん、お待たせしちゃいました\nペコリーヌ、完全復活です☆\nみなさんの食卓を守るため\nもう二度と、わたしはめげません！", 0.0, -285.0, 61, 1021307, "2026/02/12 12:00:00", "2030/01/01 14:59:59", 138301, 5.928, 10213, 1);
